    true,nt"url": null,nt"notes": "The Global Subnational Prevalence of Child
    Malnutrition dataset consists of estimates of the nnpercentage of children with
    weight-for-age z-scores that are more than two standard deviations below the median
    of the NCHS/CDC/WHO nnInternational Reference Population. Data are reported for
    the most recent year with subnational information available at the time of nndevelopment.
    The data products include a shapefile (vector data) of percentage rates, grids (raster
    data) of rates (per thousand in nnorder to preserve precision in integer format),
    the number of children under five (the rate denominator), and the number of nnunderweight
    children under five (the rate numerator), and a tabular dataset of the same and
    associated data. This dataset is produced nnby the Columbia University Center for
    International Earth Science Information Network (CIESIN).",nt"license_title":
